import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip } from 'recharts';
import Stack from '@mui/material/Stack';

const dataInv = [{
    name: 'Estimated Lost Inventory', 
    uv: 400, 
    pv: 2400, 
    amt: 2400
}];
const dataCrime = [{
    name: 'Estimated Crimes Detected',
    uv: 200,
    pv: 2200,
    amt: 2200
}]

function AdminMaster(){
    return(
        
        <div>
            <h1 style={{textAlign: 'center'}}>Recent Data</h1>
            <GraphNotified/>
        </div>
    )
}

function GraphNotified(){
    return(
        <div>
        <Stack spacing={2} direction="row" justifyContent="center" alignItems="center">
        <LineChart width={550} height={250} data={dataInv} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
        <Line type="monotone" dataKey="uv" stroke="#8884d8" />
        <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        </LineChart>


        <LineChart width={550} height={250} data={dataCrime} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
        <Line type="monotone" dataKey="uv" stroke="#8884d8" />
        <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        </LineChart>
        </Stack>
        <Stack spacing={2} direction="column" justifyContent="center" alignItems="center">
        <div className="buttonParent" style={{width: '1020px', height: '720'}}>
            <p style={{textAlign: 'center', color: 'black'}}>Notification 1</p>
        </div>
        </Stack>
        </div>
    )
}

export default AdminMaster;
